import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";

function CartItem(props) {
  return (
    <>
      <div>CartItem</div>
      <img src={props.image} width="100px" />
      <h2>{props.title}</h2>
      <h3>{props.quantity}</h3>
      <h3>{props.weight}</h3>
      <h3>{props.price}</h3>
      <button>Remove</button>
    </>
  );
}

export default CartItem;
